webpackJsonp([203],{"./node_modules/json-loader/index.js!./.cache/json/articles-python-python-boolean-operations.json":function(e,n){e.exports={data:{markdownRemark:{html:'<p><a href="https://docs.python.org/3/reference/expressions.html#and"><code>and</code></a>, <a href="https://docs.python.org/3/reference/expressions.html#or"><code>or</code></a>, <a href="https://docs.python.org/3/reference/expressions.html#not"><code>not</code></a></p>\n<p><a href="https://docs.python.org/3/library/stdtypes.html#boolean-operations-and-or-not">Python Docs - Boolean Operations</a></p>\n<p>These are the Boolean operations, ordered by ascending priority:</p>\n<table>\n<thead>\n<tr>\n<th>Operation</th>\n<th>Result</th>\n<th>Notes</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>x or y</td>\n<td>if x is false, then y, else x</td>\n<td>(1)</td>\n</tr>\n<tr>\n<td>x and y</td>\n<td>if x is false, then x, else y</td>\n<td>(2)</td>\n</tr>\n<tr>\n<td>not x</td>\n<td>if x is false, then True, else False</td>\n<td>(3)</td>\n</tr>\n</tbody>\n</table>\n<p><strong>Notes:</strong></p>\n<ol>\n<li>This is a short-circuit operator, so it only evaluates the second argument if the first one is False.</li>\n<li>This is a short-circuit operator, so it only evaluates the second argument if the first one is True.</li>\n<li>not has a lower priority than non-Boolean operators, so not a == b is interpreted as not (a == b), and a == not b is a syntax error.</li>\n</ol>\n<h2>Examples:</h2>\n<h3><code>not</code>:</h3>\n<pre><code>>>> not True\nFalse\n>>> not False\nTrue\n</code></pre>\n<h3><code>and</code>:</h3>\n<pre><code>>>> True and False    # Short-circuited at first argument.\nFalse\n>>> False and True    # Second argument is evaluated.\nFalse\n>>> True and True     # Second argument is evaluated.\nTrue\n</code></pre>\n<h3><code>or</code>:</h3>\n<pre><code>>>> True or False    # Short-circuited at first argument.\nTrue\n>>> False or True    # Second argument is evaluated.\nTrue\n>>> False or False   # Second argument is evaluated.\nFalse\n</code></pre>',frontmatter:{title:"Python Boolean Operations",parent:"/home/stuart/guides/src/pages/articles/python/python-boolean-operations/index.md absPath of file"}}},pathContext:{slug:"/articles/python/python-boolean-operations/"}}}});
